Migration from 0.x to 2.x
Steps for Migrating NativeBase from v0.x to v2.x

Upgrade NativeBase to 2.0.0-alpha1 in package.json like this
 "native-base": "2.0.0-alpha1"

The core of NativeBase has been re-written with NativeBase 2.0 and the use-cases have also changed but you can continue using the old style of using the components by importing the components from 'native-base/backward'
import { Header, Content, ... } from 'native-base/backward'.

If you have overwritten the styles of NativeBase components in your project using StyleSheet.create(), modify them to plain JavaScript objects. StyleSheet.create() is redundant as it's been called in the source of NativeBase components itself.

If you have modified the theme (using variables.js) then you need to follow these steps

You may use the existing variables.js file in your project but we have added more variables. You can diff the latest  variable.js and copy the newly introduced variables to your variables.js file

We used to overwrite the default variables of NativeBase using a theme prop in any of the NativeBase component. theme prop has been deprecated with NativeBase 2.0. To apply a custom theme, now you need to wrap your app with a   component and pass the variables.js as
